import React from 'react';


const Home = () => {
  return (
    <section className="home" id="home">
      <div className="home-content">
        <h1>Welcome to ASRC Bootcamp</h1>
        <p>We are a group of passionate tech enthusiasts and programmers, exploring the world of technology together. Our mission is to learn, share, and grow by discussing cutting-edge tools, software development practices, and the latest trends in the tech world. Whether you're a beginner or a seasoned coder, there's something here for everyone. Dive into our projects, join our discussions, and let's build the future of technology together.</p>
      </div>
      <div className="blink-message" id="scrollMsg">Scroll down ⬇️</div>
    </section>
  );
}

export default Home;
